import React from "react";

const Fooditems = ({
  macro: { nutrientName, unitName, value, nutrientId },
}) => {
  return (
    <tr>
      <th>{nutrientName}</th>
      <th>{unitName}</th>
      <th>{value}</th>
      {nutrientId>1003?<tr>macro</tr>:<tr></tr>}
    </tr>
  );
};

export default Fooditems;
